import './App.css';
import { useState } from 'react';
import Password from './passowrd';


function App() {

  const [delta,setDelta] = useState(0)
  const [passVal,setPass] = useState('weak')
  const [passVibe, setVibe] = useState(false)

  function chnageSubmitMode(data){
    setVibe(data)
  }


  function ChangeNumber(event){
    console.log(event);
    setDelta(Number(event.target.value))
  }

  function setPassowrd(pass){
    setPass(pass)
  }



  return (
    <div className="App">
      <input type = "number" value={delta} onChange = {ChangeNumber}/>
      <button disabled = {!chnageSubmitMode} >submit</button>
      <p></p>
        your password is {passVal}
      <Password  delta = {delta} setPassowrd = {setPassowrd} passVibe = {passVibe}></Password>
    </div>
  );
}

export default App;
